    false,nt"url": null,nt"notes": "This narrative report for Upper Klamath
    National Wildlife Refuge outlines Refuge accomplishments from May through July 1940.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, furbearers, predators, rodents, and raptors- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. The public relations section of the report
    describes recreational uses. Items of interest, N-R forms, and photographs.",nt"owner_org":
